import React from 'react';
import CardPic from '../components/Design/CardPic'
import { Container } from 'react-bootstrap'
import Curveball from '../assets/images/Personal/Curveball.JPG'
import CodePic from '../assets/images/Backgrounds/PankajPatelVSC.jpeg'
import '../assets/css/home.css'
import portfolioData from '../assets/portfolioData'

const Portfolio = () => {

    return(
    <div className="wallpaper" style={{backgroundImage: `url(${CodePic})` }}>
        <Container>
            {portfolioData.map(item=>(
            <CardPic 
                key={item.id}
                style={styles.projectCard}
                image={item.image}
                title={item.title}
                description={item.description}
            />
            ))}

        </Container>  
    </div>
    )
}

const styles= {
    projectCard : {
        width: '20em', 
        height: '10em', 

    }
}

export default Portfolio;
